import { BriefcaseIcon, BadgeCheckIcon } from "@heroicons/react/solid";
import React from "react";

const experiences = [
  {
    title: "Software Engineer",
    company: "ABC Tech Solutions",
    duration: "July 2020 - Present",
    description: "Implemented innovative solutions for improving system efficiency and user experience.",
  },
  {
    title: "Intern",
    company: "XYZ Software",
    duration: "May 2019 - August 2019",
    description: "Collaborated with cross-functional teams to support various stages of software development.",
  },
  // Add more experiences as needed
];

export default function Work() {
  return (
    <section id="skills">
      <div className="container px-5 py-10 mx-auto">
        <div className="text-center mb-20">
          <BriefcaseIcon className="w-10 inline-block mb-4" />
          <h1 className="sm:text-4xl text-3xl font-medium title-font text-black mb-4">
            Work Experience
          </h1>
          <p className="text-base leading-relaxed xl:w-2/4 lg:w-3/4 mx-auto">
            Leveraging my industry experience, I translate knowledge into impactful contributions. Discover my latest work and internship experiences below.
          </p>
        </div>
        <div className="flex flex-wrap -m-4">
          {experiences.map((experience, index) => (
            <div key={index} className="p-4 lg:w-1/2">
              <div className="flex border-2 rounded-lg border-gray-200 border-opacity-50 p-8 sm:flex-row flex-col">
                <BadgeCheckIcon className="text-green-500 w-6 h-6" />
                <div className="flex-grow pl-6">
                  <h2 className="text-gray-900 text-lg title-font font-medium mb-2">{experience.title}</h2>
                  <p className="leading-relaxed text-base">{experience.company}</p>
                  <p className="leading-relaxed text-base">{experience.duration}</p>
                  <p className="leading-relaxed text-base">{experience.description}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
